startselection:		.word 0
char_position:  	.word 0
char_facing_right:	.word 0
enemy1:			.word 0, 0, 0	
enemy2:			.word 0, 0, 0
enemy3:			.word 0, 0, 0
enemy4:			.word 0, 0, 0
enemy_killed:		.word 0
is_jumping:		.word 0		# indicator will be used in gravity
is_falling:		.word 0
jump_height:		.word 0
char_bullet:		.word 0, 0
platform1:		.word 0, 0
platform2:		.word 0, 0

NEWLINE:		.asciiz "\n"	#for debugging
.text

.globl main
############## main function ##############
main:	# initialization
	jal startscreen		# print the start screen
startgame:
	jal setscreen	
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 51736	# initial position of character
	sw $t0, char_position
	li $t0, 1
	sw $t0, char_facing_right	# character is facing right
	jal drawcharacter
	
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 38408
	sw $t0, enemy1		# position of enemy1
	li $t0, 1
	sw $t0, enemy1+4	# enemy1 facing right
	li $t0, 1
	sw $t0, enemy1+8	# enemy1 alive
	jal draw_enemy1
	
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 19024
	sw $t0, enemy2		# position of enemy2
	li $t0, 0
	sw $t0, enemy2+4	# enemy2 facing left
	li $t0, 1
	sw $t0, enemy2+8	# enemy2 alive
	jal draw_enemy2
	
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 8920
	sw $t0, enemy3
	li $t0, 0
	sw $t0, enemy3+4
	li $t0, 1
	sw $t0, enemy3+8
	jal draw_enemy3
	
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 34264
	sw $t0, enemy4
	li $t0, 0
	sw $t0, enemy4+4
	li $t0, 1
	sw $t0, enemy4+8
	jal draw_enemy4
	
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 13072
	sw $t0, platform1
	li $t0, 0
	sw $t0, platform1+4
	jal draw_platform1
	
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 58200
	sw $t0, platform2
	li $t0, 1
	sw $t0, platform2+4
	jal draw_platform2
	
	li $t0, 0
	sw $t0, is_jumping
	sw $t0, is_falling
	sw $t0, jump_height
	sw $t0, char_bullet
	sw $t0, enemy_killed
gameloop:
	jal draw_flag
	jal check_keypress
	jal do_gravity			# fall if not on platform
	jal update_jump			# continue jumping if mid-jump
	jal update_enemy1
	jal update_enemy2
	jal update_enemy3
	jal update_enemy4
	jal char_bullet_update
	jal update_platform1
	jal update_platform2
	jal check_win
	
	li $v0, 32
	li $a0, 40
	syscall
	
	j gameloop

check_keypress:
	li $t9, KEYSTROKE_ADDRESS
	lw $t8, 0($t9)			# checking for keystroke
	beq $t8, 1, keypress_happened	# checking for keystroke
	jr $ra

keypress_happened:
	lw $t2, 4($t9)
	beq $t2, 0x77, do_jump		# if w was pressed
	beq $t2, 0x61, move_left	# if a was pressed
	beq $t2, 0x73, move_down	# if s was pressed
	beq $t2, 0x64, move_right	# if d was presse
	beq $t2, 0x20, char_shoot	# if space was pressed
	beq $t2, 0x70, main		# if p was pressed
	jr $ra
	
############## check win ##############
check_win:
	lw $t0, enemy_killed
	bne $t0, 4, end_check_win
	lw $t0, char_position
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	bgt $t0, 4084, end_check_win
	andi $t0, $t0, 508
	addi $t0, $t0, 36
	bge $t0, 440, winscreen
end_check_win:
	jr $ra

############## player movement ##############
move_left:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal check_left_collisions
	jal clear_current_character
	lw $t0, char_position
	addi $t0, $t0, -4
	sw $t0, char_position
	li $t0, 0
	sw $t0, char_facing_right
	jal drawcharacter
move_left_end:
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
move_right:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal check_right_collisions
	jal clear_current_character
	lw $t0, char_position
	addi $t0, $t0, 4
	sw $t0, char_position
	li $t0, 1
	sw $t0, char_facing_right
	jal drawcharacter
move_right_end:
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
move_down:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal check_down_collisions
	jal clear_current_character
	lw $t0, char_position
	addi $t0, $t0, 512
	sw $t0, char_position
	jal drawcharacter
move_down_end:
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra
move_down_end_with_collision:
	li $t0, 0
	sw $t0, is_falling
	sw $t0, is_jumping
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
move_up:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal check_up_collisions
	jal clear_current_character
	lw $t0, char_position
	addi $t0, $t0, -512
	sw $t0, char_position
	jal drawcharacter	
move_up_end:
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra
move_up_end_with_collision:
	li $t0, 1
	sw $t0, is_falling
	li $t0, 0
	sw $t0, jump_height
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra

do_jump:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	lw $t0, is_jumping
	beq $t0, 2, do_jump_end
	addi $t0, $t0, 1
	sw $t0, is_jumping
	li $t1, 0
	sw $t1, jump_height
	sw $t1, is_falling	
do_jump_end:
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
update_jump:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	lw $t0, is_falling
	beq $t0, 1, update_jump_end
	lw $t0, is_jumping
	beq $t0, 0, update_jump_end
	lw $t0, jump_height
	beq $t0, 15, move_up_end_with_collision
	addi $t0, $t0, 1
	sw $t0, jump_height
	jal check_up_collisions
	lw $ra 0($sp)
	addi $sp, $sp, 4
	j move_up
update_jump_end:
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
############## gravity movement ##############
do_gravity:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	lw $t0, is_falling
	beq $t0, 1, do_falling_gravity	# do gravity regardless of jump status
	lw $t0, is_jumping
	bne $t0, 0, end_do_gravity	# dont do gravity if mid-jump
do_falling_gravity:
	jal check_down_collisions
	lw $ra 0($sp)
	addi $sp, $sp, 4
	j move_down
end_do_gravity:
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra

############## check collisions ##############
check_left_collisions:
	lw $t0, char_position
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	andi $t0, 508
	beq $t0, 8, move_left_end		# character at left edge
	lw $t0, char_position
	addi $t0, $t0, -4
	li $t1, ORANGE
	li $t2, 0
check_left_collision_loop:
	beq $t2, 11, check_left_collision_loop_end
	lw $t3, 0($t0)
	beq $t3, $t1, move_left_end		# collision with platform
	addi $t0, $t0, 512
	addi $t2, $t2, 1
	j check_left_collision_loop
check_left_collision_loop_end:
	addi $sp, $sp, -4
	sw $ra 0($sp)
	jal check_enemy1_player_collision_left
	jal check_enemy2_player_collision_left
	jal check_enemy3_player_collision_left
	jal check_enemy4_player_collision_left
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra		# no complications
	
check_right_collisions:
	lw $t0, char_position
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	andi $t0, 508
	beq $t0, 464, move_right_end		# character at right edge
	lw $t0, char_position
	addi $t0, $t0, 40
	li $t1, ORANGE
	li $t2, 0
check_right_collision_loop:
	beq $t2, 11, check_right_collision_loop_end
	lw $t3, 0($t0)
	beq $t3, $t1, move_right_end	# collision with platform
	addi $t0, $t0, 512
	addi $t2, $t2, 1
	j check_right_collision_loop
check_right_collision_loop_end:
	addi $sp, $sp, -4
	sw $ra 0($sp)
	jal check_enemy1_player_collision_right
	jal check_enemy2_player_collision_right
	jal check_enemy3_player_collision_right
	jal check_enemy4_player_collision_right
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra		# no complications
	
check_down_collisions:
	lw $t0, char_position
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	addi $t0, $t0, 5632
	bgt $t0, 65536, move_down_end_with_collision	# character at bottom edge (shouldn't be possible)
	lw $t0, char_position
	addi $t0, $t0, 5632
	li $t1, ORANGE
	li $t2, 0
check_down_collision_loop:
	beq $t2, 10, check_down_collision_loop_end
	lw $t3, 0($t0)
	beq $t1, $t3, move_down_end_with_collision		# collision with platform
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	j check_down_collision_loop
check_down_collision_loop_end:
	lw $t0, char_position
	addi $t0, $t0, 5632
	li $t1, WATER
	li $t2, 0
check_down_collision_loop2:
	beq $t2, 10, check_down_collision_loop2_end
	lw $t3, 0($t0)
	beq $t1, $t3, gameoverscreen		# collision with water, leads to gameover
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	j check_down_collision_loop2
check_down_collision_loop2_end:
	addi $sp, $sp, -4
	sw $ra 0($sp)
	jal check_enemy1_player_collision_down
	lw $ra 0($sp)
	addi $sp, $sp, 4
	jr $ra

check_up_collisions:
	lw $t0, char_position
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	addi $t0, $t0, -512
	blt $t0, 1028, move_up_end_with_collision	# character at top edge
	lw $t0, char_position
	addi $t0, $t0, -512
	li $t1, ORANGE
	li $t2, 0
check_up_collision_loop:
	beq $t2, 10, check_up_collision_loop_end
	lw $t3, 0($t0)
	beq $t1, $t3, move_up_end_with_collision		# collision with platform
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	j check_up_collision_loop
check_up_collision_loop_end:
	jr $ra
	
check_enemy1_player_collision_right:
	lw $t1, enemy1+8
	beq $t1, 0, end_check_enemy1_player_collision_right
	lw $t1, char_position
	lw $t2, enemy1
	addi $t1, $t1, 5160
	blt $t1, $t2, end_check_enemy1_player_collision_right
	lw $t1, char_position
	lw $t2, enemy1
	addi $t2, $t2, 3616
	bgt $t1, $t2, end_check_enemy1_player_collision_right
	li $t0, BASE_ADDRESS
	lw $t1, char_position
	lw $t2, enemy1
	sub $t1, $t1, $t0
	sub $t2, $t2, $t0
	andi $t1, $t1, 508
	andi $t2, $t2, 508
	blt $t2, $t1, end_check_enemy1_player_collision_right
	addi $t1, $t1, 40
	bge $t1, $t2, gameoverscreen
end_check_enemy1_player_collision_right:
	jr $ra
	
check_enemy1_player_collision_left:
	lw $t1, enemy1+8
	beq $t1, 0, end_check_enemy1_player_collision_left
	lw $t1, char_position
	lw $t2, enemy1
	addi $t1, $t1, 5160
	blt $t1, $t2, end_check_enemy1_player_collision_left
	lw $t1, char_position
	lw $t2, enemy1
	addi $t2, $t2, 3616
	bgt $t1, $t2, end_check_enemy1_player_collision_left
	li $t0, BASE_ADDRESS
	lw $t1, char_position
	lw $t2, enemy1
	sub $t1, $t1, $t0
	sub $t2, $t2, $t0
	andi $t1, $t1, 508
	andi $t2, $t2, 508
	bgt $t2, $t1, end_check_enemy1_player_collision_left
	addi $t2, $t2, 32
	bge $t2, $t1, gameoverscreen
