############## selection input ##############
select_input:
	li $t1, KEYSTROKE_ADDRESS
select_input_loop:
	lw $t2, 0($t1)
	beq $t2, 1, select_input_key_pressed
	j select_input_loop
select_input_key_pressed:
	lw $t2, 4($t1)
	beq $t2, 0x77, select_start
	beq $t2, 0x73, select_quit
	beq $t2, 0x7A, selection_made
	j select_input_loop
	
select_start:
	li $t0, 0
	sw $t0, startselection
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 20104
	li $t1, ORANGE
	jal draw_selection_box
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 30856
	li $t1, BLACK
	jal draw_selection_box
	j select_input
	
select_quit:
	li $t0, 1
	sw $t0, startselection
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 20104
	li $t1, BLACK
	jal draw_selection_box
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 30856
	li $t1, ORANGE
	jal draw_selection_box
	j select_input
	
selection_made:
	lw $t0, startselection
	beq $t0, 0, startgame
	beq $t0, 1, EXIT
	j select_input
	
draw_selection_box:
	li $t2, 0
	move $t3, $t0
draw_horizontal_loop:
	beq $t2, 60, end_draw_horizontal_loop
	sw $t1, 0($t3)
	sw $t1 512($t3)
	sw $t1, 8192($t3)
	sw $t1, 8704($t3)
	addi $t3, $t3, 4
	addi $t2, $t2, 1
	j draw_horizontal_loop
end_draw_horizontal_loop:
	li $t2, 0
	move $t3, $t0
draw_vertical_loop:
	beq $t2, 18, end_draw_vertical_loop
	sw $t1, 0($t3)
	sw $t1, 4($t3)
	sw $t1, 232($t3)
	sw $t1, 236($t3)
	addi $t3, $t3, 512
	addi $t2, $t2, 1
	j draw_vertical_loop
end_draw_vertical_loop:
	jr $ra

############## start screen ##############
startscreen:
	li $t0, BASE_ADDRESS
	la $t1, STARTSCREEN
	li $t2, 0
startscreen_loop:
	beq $t2, 16384, startscreen_loop_end
	lw $t3, 0($t1)
	sw $t3, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	addi $t2, $t2, 1
	j startscreen_loop
startscreen_loop_end:
	j select_input

############## set screen ##############
setscreen:
	li $t0, BASE_ADDRESS
	la $t1, SETSCREEN
	li $t2, 0
setscreen_loop:
	beq $t2, 16384, setscreen_loop_end
	lw $t3, 0($t1)
	sw $t3, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	addi $t2, $t2, 1
	j setscreen_loop
setscreen_loop_end:
	jr $ra

############## gameover input ##############
gameover_input:
	li $t1, KEYSTROKE_ADDRESS
gameover_input_loop:
	lw $t2, 0($t1)
	beq $t2, 1, gameover_input_key_pressed
	j gameover_input_loop
gameover_input_key_pressed:
	lw $t2, 4($t1)
	beq $t2, 0x77, select_try_again
	beq $t2, 0x73, gameover_quit
	beq $t2, 0x7A, gameover_selection_made
	j gameover_input_loop
	
select_try_again:
	li $t0, 0
	sw $t0, startselection
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 30800
	li $t1, ORANGE
	jal draw_selection_box2
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 41040
	li $t1, BLACK
	jal draw_selection_box2
	j gameover_input
	
gameover_quit:
	li $t0, 1
	sw $t0, startselection
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 30800
	li $t1, BLACK
	jal draw_selection_box2
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 41040
	li $t1, ORANGE
	jal draw_selection_box2
	j gameover_input
	
gameover_selection_made:
	lw $t0, startselection
	beq $t0, 0, startgame
	beq $t0, 1, EXIT
	j gameover_input
	
draw_selection_box2:
	li $t2, 0
	move $t3, $t0
draw_horizontal_loop2:
	beq $t2, 92, end_draw_horizontal_loop2
	sw $t1, 0($t3)
	sw $t1 512($t3)
	sw $t1, 8192($t3)
	sw $t1, 8704($t3)
	addi $t3, $t3, 4
	addi $t2, $t2, 1
	j draw_horizontal_loop2
end_draw_horizontal_loop2:
	li $t2, 0
	move $t3, $t0
draw_vertical_loop2:
	beq $t2, 18, end_draw_vertical_loop2
	sw $t1, 0($t3)
	sw $t1, 4($t3)
	sw $t1, 360($t3)
	sw $t1, 364($t3)
	addi $t3, $t3, 512
	addi $t2, $t2, 1
	j draw_vertical_loop2
end_draw_vertical_loop2:
	jr $ra

############## gameover screen ##############
gameoverscreen:
	li $t0, BASE_ADDRESS
	la $t1, GAMEOVERSCREEN
	li $t2, 0
gameoverscreen_loop:
	beq $t2, 16384, gameoverscreen_loop_end
	lw $t3, 0($t1)
	sw $t3, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	addi $t2, $t2, 1
	j gameoverscreen_loop
gameoverscreen_loop_end:
	j gameover_input

############## win input ##############
win_input:
	li $t1, KEYSTROKE_ADDRESS
win_input_loop:
	lw $t2, 0($t1)
	beq $t2, 1, win_input_key_pressed
	j win_input_loop
win_input_key_pressed:
	lw $t2, 4($t1)
	beq $t2, 0x77, win_main_menu
	beq $t2, 0x73, win_quit
	beq $t2, 0x7A, win_selection_made
	j win_input_loop
	
win_main_menu:
	li $t0, 0
	sw $t0, startselection
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 30800
	li $t1, ORANGE
	jal draw_selection_box2
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 41040
	li $t1, BLACK
	jal draw_selection_box2
	j win_input
	
win_quit:
	li $t0, 1
	sw $t0, startselection
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 30800
	li $t1, BLACK
	jal draw_selection_box2
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 41040
	li $t1, ORANGE
	jal draw_selection_box2
	j win_input
	
win_selection_made:
	lw $t0, startselection
	beq $t0, 0, main
	beq $t0, 1, EXIT
	j win_input
	
############## win screen ##############
winscreen:
	li $t0, BASE_ADDRESS
	la $t1, WINSCREEN
	li $t2, 0
winscreen_loop:
	beq $t2, 16384, winscreen_loop_end
	lw $t3, 0($t1)
	sw $t3, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	addi $t2, $t2, 1
	j winscreen_loop
winscreen_loop_end:
	j win_input

############## termination ##############
EXIT:
	li $v0, 10	# terminates the program
	syscall
